        [TestMethod]
        public void Will_Create_Correct_Json()
        {
            var xRoot = new XmlRootAttribute();
            xRoot.ElementName = "map";

            XmlSerializer deserializer = new XmlSerializer(typeof(object), xRoot);
            var item = deserializer.Deserialize(xmlfile.ToStream());

            
            var t = new XmlSerializer(typeof(Tilemap), xRoot);
            var map = t.Deserialize(xmlfile.ToStream()) as Tilemap;

            var d = map.Layers[0].Data[1];

            var json = map.GetJson();

            var correctjsonlines = jsonfile.Split('\n');
            var testjsonlines = json.Split('\n');

            for (var index = 0; index < correctjsonlines.Length; index++)
            {
                Assert.AreEqual(correctjsonlines[index].Trim(), testjsonlines[index].Trim(), $"Fejl på linie {index}");
            }
        }

        [TestMethod]
        public void Will_Create_Correct_Json_With_Terraininformation()
        {
            var xRoot = new XmlRootAttribute();
            xRoot.ElementName = "map";

            XmlSerializer deserializer = new XmlSerializer(typeof(object), xRoot);
            var item = deserializer.Deserialize(xmlfileWithTerrainInformation.ToStream());


            var t = new XmlSerializer(typeof(Tilemap), xRoot);
            var map = t.Deserialize(xmlfileWithTerrainInformation.ToStream()) as Tilemap;

            var d = map.Layers[0].Data[1];

            var json = map.GetJson();

            var correctjsonlines = jsonfileWithTerrainInformation.Split('\n');
            var testjsonlines = json.Split('\n');

            for (var index = 0; index < correctjsonlines.Length; index++)
            {
                var expected = correctjsonlines[index].Trim();
                var actual = testjsonlines[index].Trim();
                Assert.AreEqual(expected, actual, $"Fejl på linie {index+1}");
            }
        }


